import {deviceActionEnum} from "../reducers/device/types";

export const deviceActionCreators = {
    ASTypes: (payload) => ({type: deviceActionEnum.SET_TYPES, payload}),
    ASBrands: (payload) => ({type: deviceActionEnum.SET_BRANDS, payload}),
    ASDevice: (payload) => ({type: deviceActionEnum.SET_DEVICES, payload}),
}
